export const sortCards = async list => {
	let sortedCards = {};
	for (let index = 0; index < list.length; index++) {
		const {
			archetype,
		} = list[index];
		sortedCards = {
			...sortedCards,
			[archetype]: {
				...sortedCards[archetype],
				...list[index],
			},
		}
	}
	console.log(sortedCards);
}
